就会标识为没更新了，可能未来会解决。"},{q:"一键更新不可以只更新有更新的或者自己选吗？",a:"有两个原因，1是同上面那个问题的最近更新，2是作者最近没有时间实现（也就是我）。"},{q:"评论功能为什么不可用？",a:"本地模式下不支持评论，请访问在线仓库并登录github账号后评论，如何使用github请自行查找。"},{q:"为什么没有XX脚本？",a:"善用搜索，搜索时尽量保证关键词准确，如“甜甜花”，或者“伐木”搜不到就搜“砍树”。如果每一个都找过后仍未找到，那么就是没有作者写，可以自行尝试编写一个。"},{q:"README是什么，为什么加载失败了？为什么没有显示？",a:"自己先读一遍README，读懂了吗？加载失败情况同第一问。没显示是因为该目录下不存在README.md文件。"},{q:"一些链接为什么点不开？加载半天为什么加载不出来？",a:"同第一问。"},{q:"点击订阅后为什么没反应？",a:"请打开BGI，这时会有导入窗口弹出，选择导入。如果你使用的是在线仓库，刷新BGI页面后没有你订阅的脚本，请更新本地仓库后重试，还有异常请在相关群中提问。"},{q:"这个脚本用不了怎么办？",a:"请在相关群中提问，具体问题具体分析，提问时确保你的截图和描述充分。"},{q:"我之前的评论怎么不见了？",a:"一般不会删评，如果评论消失大概率是你评论的节点路径改变了，比如水晶矿这个目录被改名成了晶水矿，那就会导致你看到的是新的评论区。"},{q:"这个脚本为什么不用纳西妲？",a:"作者们都需要考虑是不是所有人都有，如果需要请尝试自己做一个。"},{q:"我想要XX功能怎么办？",a:"没有作者写那就自己写一个！"},{q:"其它",a:"更多问题请联系我，如有价值也会不定期更新该页面。"}]},d6e={descTitle:"简介：",noDesc:"无简介",loadTimeout:"加载超时",loadFailed:"加载失败",clickToViewFile:"点击查看GitHub仓库中的文件",clickToViewDir:"点击查看GitHub仓库中的目录",invalidLinkHint:"（这个作者很笨，把链接写错了，去提醒ta修改吧）",iframeNotice:"由于安全限制，无法直接显示此内容，请使用本地仓库查看"},f6e={help:"帮助",jumpToGitHub:"GitHub",comment:"评论",subscribe:"一键更新",update:"查看更新",plan:"更新计划",recent:"以下脚本最近有更新",updateAll:"是否一键更新所有已订阅项",clearDot:"清除红点提示",subscribed:"已订阅",confirm:"确定",cancel:"取消"},p6e={subscribed:"已订阅",subscribe:"订阅",subscribeAgain:"再次订阅",selectValidNode:"请选择一个有效的节点进行订阅",subscribeFailed:"订阅失败",subscribeFailedWithMsg:"订阅失败: {msg}",subscribeSuccess:"已将 {name} 的订阅链接复制到剪贴板",copyFailed:"复制 {name} 的订阅链接失败",noDesc:"无简介"},m6e={hasUpdate:"有更新",subscribed:"已订阅",noAuthor:"佚名"},g6e={hasUpdate:"有更新",subscribed:"已订阅",noAuthor:"佚名"},_6e={hasUpdate:"有更新",subscribed:"已订阅",noAuthor:"佚名"},h6e={comma:"，",noDesc:"无简介",reset:"重置",confirm:"确定"},v6e={author:"作者：",scriptAuthor:"作者",noAuthor:"佚名",subscribe:"订阅",subscribed:"已订阅",subscribeAgain:"再次订阅",subscribeFailed:"订阅失败",subscribeFailedWithMsg:"订阅失败: {msg}",subscribeSuccess:"已将 {name} 的订阅链接复制到剪贴板",copyFailed:"复制 {name} 的订阅链接失败",loadingReadme:"正在加载readme文件",readmeFailed:"readme文件加载失败，请重试",loadingStrategy:"正在加载策略文件内容",strategyFailed:"策略文件加载失败，请重试 取得倉庫資訊失敗",repoDesc:"請檢查網路或稍後重新整理頁面重試"},w6e={title:"評論",localModeTitle:"本地模式暫不支援評論功能",localModeDesc:"請移步線上倉庫進行評論"},R6e={title:"小彩蛋",loading:"彩蛋正在拼盡全力載入…",error:"拼盡全力無法戰勝，載入失敗，請重試"},I6e={title:"更新計劃",desc:"以下列舉了一些未來的更新計劃，歡迎大家補充或幫助實現，目前作者僅我一人，更新速度不會太快，還請諒解！",link:"倉庫頁面地址：https://github.com/zaodonganqi/bettergi-script-web",author:"作者郵箱：anqi4051{'@'}gmail.com",planList:[{desc:"主題色支援",content:"目前項目使用的顏色配置仍處於零散狀態，計劃整合顏色以支援整體主題色配置。待定的方案有黑夜模式與半透明模式（以支援自訂背景顯示）。"},{desc:"強化一鍵訂閱",content:"在有更新的腳本中尋找你已經訂閱的腳本來篩選可以一鍵更新的腳本，當然現在的無腦全部更新一遍也沒多慢就是啦。"},{desc:"內部新增使用教學文件",content:"在工具列上新增倉庫使用教學給電腦新手看，但是看不懂字的除外。"},{desc:"內容區域可拖動",content:"將列表等視圖修改為可以被拖動改變大小的視圖而不是現在的定值，同時儲存資料到本地（快取不靠譜的情況下考慮在本體增加配置檔案）。"},{desc:"更強大的搜尋",content:"搜尋功能強化，目前的搜尋只是關鍵詞檢測，需要考慮模糊匹配（此項優先級不高，吃力不討好）。"},{desc:"更高級的動畫",content:"UI互動提供更多動效。"},{desc:"完善有更新腳本列表",content:"為頁面新增類似路由的機制（但不是路由），在檢視更新裡就能實現點選跳轉。"},{desc:"作者的悄悄話",content:"悄悄話就不寫在標題裡了，诶嘿！目前作者的事務比較繁忙，個人事業學業工作都要兼顧，請不要嫌我更新慢嗚嗚嗚。你催更的最好方法就是贊助作者或給卑微的作者點個star（聽不懂star是什麼就算了）。"}]},A6e={title:"常見問題 Q&A",modalTitle:"觀前提示：任何問題都應該經過自己的思考或查看文件後再提出",author:"作者信箱：anqi4051{'@'}gmail.com",qa:[{q:"為什麼倉庫一直載入失敗？",a:"倉庫使用的是github的地址，國內直接連接可能會時好時壞，屬正常現象，打不開就多試幾次或者過幾分鐘再來試試，也可以使用BGI的本地倉庫頁面。（如果你是一個魔法師，你知道怎麼做）"},{q:"評論功能為什麼不可用？",a:"本地模式下不支援評論，請訪問線上倉庫並登入github帳號後評論，如何使用github請自行查找。"},{q:"為什麼沒有XX腳本？",a:"搜尋時盡量保證關鍵詞準確，如「甜甜花」，如果每一個都找過後仍未找到，那麼就是沒有作者寫，可以自行嘗試編寫一個。"},{q:"已訂閱功能怎麼用？",a:"「BetterGI → 設定 → BetterGI Http 伺服器設定」（如未找到該設定，請確保BGI已更新至最新版），確保該項已開啟且埠號設定為30648。完成後請關閉此頁面並重新啟動BGI再次嘗試，仍有問題請聯繫作者解決。"},{q:"README是什麼，為什麼載入失敗了？為什麼沒有顯示？",a:"自己先讀一遍README，讀懂了嗎？載入失敗情況同第一問。沒顯示是因為該目錄下不存在README.md檔案。"},{q:"一些連結為什麼點不開？載入半天為什麼載入不出來？",a:"同第一問。"},{q:"點擊訂閱後為什麼沒反應？",a:"請開啟BGI，這時會有匯入視窗彈出，選擇匯入。如果你使用的是線上倉庫，重新整理BGI頁面後沒有你訂閱的腳本，請更新本地倉庫後重試，還有異常請在相關群中提問。"},{q:"這個腳本用不了怎麼辦？",a:"請在相關群中提問，具體問題具體分析，提問時確保你的截圖和描述充分。"},{q:"我之前的評論怎麼不見了？",a:"一般不會刪評，如果評論消失大概率是你評論的節點路徑改變了，比如水晶礦這個目錄被改名成了晶水礦，那就會導致你看到的是新的評論區。"},{q:"這個腳本為什麼不用納西妲？",a:"作者們都需要考慮是不是所有人都有，如果需要請嘗試自己做一個。"},{q:"我想要XX功能怎麼辦？",a:"沒有作者寫那就自己寫一個！"},{q:"其它",a:"更多問題請聯繫我，如有價值也會不定期更新該頁面。"}]},N6 t them. Currently, I am the only author, so the update speed may not be very fast. Thank you for your understanding!",link:"Repository URL: https://github.com/zaodonganqi/bettergi-script-web",author:"Author's Email: anqi4051{'@'}gmail.com",planList:[{desc:"Theme Color Support",content:"The color configuration currently used in the project is still fragmented. We plan to consolidate the colors to support overall theme color configuration. Pending solutions include dark mode and translucent mode (to support custom background display)."},{desc:"Enhance One-Click Subscription",content:"Find scripts you have already subscribed to among the updated scripts to filter those that can be updated with one click. Of course, blindly updating all of them isn't very slow right now anyway."},{desc:"Add Internal Tutorial Documentation",content:"Add a repository usage tutorial on the toolbar for computer novices, except for those who can't read words."},{desc:"Draggable Content Areas",content:"Modify views like lists to be resizable by dragging rather than fixed values, and save the data locally (consider adding a configuration file in the main body if caching is unreliable)."},{desc:"More Powerful Search",content:"Enhance the search function. The current search is only keyword detection; fuzzy matching needs to be considered (this item has low priority, as it's a lot of effort for little reward)."},{desc:"More Advanced Animations",content:"Provide more animation effects for UI interactions."},{desc:"Improve the Updated Scripts List",content:"Add a route-like mechanism (but not actual routing) to the page, allowing click-to-navigate within the update view."},{desc:"Author's Whisper",content:"I won't write the whisper in the title, ehe! Currently, the author is quite busy juggling personal projects, studies, and work. Please don't blame me for the slow updates, wuwuwu. The best way to urge me to update is to sponsor the author or give this humble author a star (if you don't know what a star is, just forget it)."}]},Q6e={title:"FAQ Q&A",modalTitle:"Note: Any questions should be thought through or documented before asking",author:"Author email: anqi4051{'@'}gmail.com",qa:[{q:"Why does the repository keep failing to load?",a:"The repository uses GitHub addresses, and direct connections from China may be intermittent, which is normal. If it doesn't open, try a few more times or come back in a few minutes. You can also use BGI's local repository page. (If you're a wizard, you know what to do)"},{q:"Why is the comment function unavailable?",a:"Comments are not supported in local mode. Please visit the online repository and log in to your GitHub account to comment. How to use GitHub, please search for yourself."},{q:"Why is there no XX script?",a:`When searching, try to ensure keywords are accurate, such as "Sweet Flower". If you've searched everything and still can't find it, then no author has written it. You can try writing one yourself.`},{q:"How to use the subscribed function?",a:`"BetterGI → Settings → BetterGI Http Server Settings" (if you can't find this setting, please make sure BGI is updated to the latest version), ensure this item is enabled and the port number is set to 30648. After completion, please close this page and restart BGI to try again. If there are still issues, please contact the author for resolution.`},{q:"What is README, why did it fail to load? Why is it not displayed?",a:"Read the README yourself first, do you understand it? Loading failure is the same as the first question. It's not displayed because there's no README.md file in that directory."},{q:"Why can't some links be clicked? Why does it load for a long time without loading?",a:"Same as the first question."},{q:"Why is there no response after clicking subscribe?",a:"Please open BGI, an import window will pop up, select import. If you're using the online repository and the script you subscribed to doesn't appear after refreshing the BGI page, please update the local repository and try again. If there are still issues, please ask in the relevant group."},{q:"What should I do if this script doesn't work?",a:"Please ask in the relevant group, specific problems require specific analysis. When asking, make sure your screenshots and descriptions are sufficient."},{q:"Why are my previous comments gone?",a:"Comments are generally not deleted. If comments disappear, it's likely because the node path you commented on has changed. For example, if the Crystal Ore directory was renamed to Crystal Water Ore, you'll see a new comment section."},{q:"Why doesn't this script use Nahida?",a:"Authors need to consider whether everyone has her. If needed, try making one yourself."},{q:"What should I do if I want XX function?",a:"If no author has written it, write one yourself!"},{q:"Others",a:"For more questions, please contact me. If valuable, this page will be updated periodically."}]},Z6e={descTitle:"Description: ",noDesc:"No description",loadTimeout:"Load timeout",loadFailed:"Load failed",clickToViewFile:"Click to view file in GitHub repository",clickToViewDir:"Click to view directory in GitHub repository",invalidLinkHint:"(This author is stupid and wrote the link wrong, go remind them to fix it)",iframeNotice:"Due to security restrictions, this content cannot be displayed directly. Please use local repository to view"},J6e={help:"Help",jumpToGitHub:"GitHub",comment:"Comment",subscribe:"One-Click Update",update:"Check for Updates",plan:"Update Plan",recent:"Recent Updates",updateAll:"Update All Subscriptions?",clearDot:"Clear Red Dot",subscribed:"Subscribed",confirm:"Confirm",cancel:"Cancel"},eFe={subscribed:"Subscribed",subscribe:"Subscribe",subscribeAgain:"Subscribe Again",selectValidNode:"Please select a valid node to subscribe",subscribeFailed:"Subscribe failed",subscribeFailedWithMsg:"Subscribe failed: {msg}",subscribeSuccess:"Subscription link for {name} has been copied to clipboard",copyFailed:"Failed to copy subscription link for {name} List:rFe,common:oFe,detail:aFe,settings:iFe,sort:lFe,loading:sFe,"repoError.title":"Failed to get repository information","repoError.desc":"Please check your network or refresh the page later","repoError.refresh":"Refresh Page","repoError.help":"View Help","script.unknownScript":"Unknown Script","script.author":"Author: ","script.noAuthor":"Anonymous","comment.localModeNoticeTitle":"Comments not supported in local mode","comment.localModeNoticeDesc":"Please visit the online repository for comments","comment.onlineRepo":"Visit Online Repository","egg.failed":"Failed to load despite best efforts, please retry","egg.title":"Easter Egg","egg.loading":"Easter egg is trying its best to load...","script.searchMap":"Search resource name, author, tag","script.onlyLocal":"Only available in local mode","comment.title":"Comments","script.searchScript":"Search script name, author, description, tag","script.searchCombat":"Search combat strategy name, author, tag","script.searchTCG":"Search TCG strategy name, author, tag","script.searchDefault":"Enter keywords to search"},uFe={map:"マップ追跡",script:"Javascript スクリプト",combat:"戦闘戦略",tcg:"七聖召喚戦略"},dFe={ok:"確定",cancel:"キャンセル",refresh:"ページを更新",help:"ヘルプを表示",all:"すべて",subscribed:"購読済み",visitOnline:"オンラインリポジトリにアクセス"},fFe={repoTitle:"スクリプトリポジトリ",mainRepo:"BetterGIメインリポジトリにアクセス",scriptRepo:"BetterGIスクリプトリポジトリにアクセス",onlineRepo:"オンラインリポジトリにアクセス",lastUpdate:"最終更新：",document:"公式ドキュメントを確認する"},pFe={all:"すべて",subscribed:"購読済み",onlyLocal:"ローカルモードでのみ利用可能",searchMap:"リソース名、作者、タグを検索",searchScript:"キーワードを入力して検索",searchCombat:"キーワードを入力して検索",searchTCG:"キーワードを入力して検索",searchDefault:"キーワードを入力して検索",author:"作者：",noAuthor:"匿名",unknown:"不明なスクリプト"},mFe={repoTitle:"リポジトリ情報の取得に失敗しました",repoDesc:"ネットワークを確認するか、後でページを更新してください"},gFe={title:"コメント",localModeTitle:"ローカルモードではコメント機能がサポートされていません",localModeDesc:"オンラインリポジトリでコメントしてください"},_Fe={title:"イースターエッグ",loading:"イースターエッグが全力で読み込み中…",error:"全力を尽くしましたが、読み込みに失敗しました。再試行してください"},hFe={title:"更新計画",desc:"以下は今後の更新計画です。皆さんのご意見や実装へのご協力をお待ちしています。現在、作者は私一人のみのため、更新速度はあまり速くありません。ご了承ください！",link:"リポジトリページアドレス：https://github.com/zaodonganqi/bettergi-script-web",author:"作者メール：anqi4051{'@'}gmail.com",planList:[{desc:"テーマカラーサポート",content:"現在、プロジェクトで使用されているカラー設定はまだ分散した状態です。カラーを統合して全体のテーマカラー設定をサポートする計画です。保留中の方案にはダークモードと半透明モード（カスタム背景表示をサポートするため）があります。"},{desc:"ワンクリック購読の強化",content:"更新されたスクリプトの中から既に購読しているスクリプトを探し、ワンクリックで更新できるスクリプトをフィルタリングします。もちろん、今の全てを盲目的に更新するのもそれほど遅くはありません。"},{desc:"内部チュートリアルドキュメントの追加",content:"ツールバーにリポジトリの使用チュートリアルを追加して、コンピュータ初心者向けに提供します（ただし、文字が読めない人は除く）。"},{desc:"コンテンツ領域のドラッグ可能化",content:"リストなどのビューを、現在の固定値ではなくドラッグでサイズ変更可能なビューに変更し、データをローカルに保存します（キャッシュが信頼できない場合は、本体に設定ファイルを追加することを検討します）。"},{desc:"より強力な検索",content:"検索機能の強化。現在の検索はキーワード検出のみです。あいまい一致を検討する必要があります（この項目の優先度は高くなく、労力の割に効果が薄いです）。"},{desc:"より高度なアニメーション",content:"UIインタラクションにより多くの動的効果を提供します。"},{desc:"更新済みスクリプトリストの改善",content:"ページにルートに似たメカニズム（ただしルーティングではありません）を追加し、更新確認画面内でクリックして移動できるようにします。"},{desc:"作者のささやき",content:"ささやきはタイトルには書きませんよ、えへっ！現在、作者は個人の事業、学業、仕事を両立させており、非常に忙しいです。更新が遅いからといって責めないでください、呜呜呜。更新を促す最善の方法は、作者をスポンサーになるか、卑しい作者にスターを付けることです（スターが何か分からない場合は、気にしないでください）。"}]},vFe={title:"よくある質問 Q&A",modalTitle:"事前注意：質問する前に自分で考えたり、ドキュメントを確認してください",author:"作者メール：anqi4051{'@'}gmail.com",qa:[{q:"なぜリポジトリが常に読み込みに失敗するのですか？",a:"リポジトリはGitHubのアドレスを使用しており、中国からの直接接続は断続的になる可能性があり、これは正常な現象です。開かない場合は何度か試すか、数分後に再試行してください。BGIのローカルリポジトリページも使用できます。（魔法使いの方は、どうすればよいかご存知です）"},{q:"なぜコメント機能が利用できないのですか？",a:"ローカルモードではコメントがサポートされていません。オンラインリポジトリにアクセスしてGitHubアカウントにログインしてからコメントしてください。GitHubの使用方法は自分で調べてください。"},{q:"なぜXXスクリプトがないのですか？",a:"検索する際は、キーワードが正確であることを確認してください。例えば「スイートフラワー」などです。すべてを検索しても見つからない場合は、作者が書いていないということです。自分で書いてみることもできます。"},{q:"購読機能はどのように使用しますか？",a:"「BetterGI → 設定 → BetterGI Http サーバー設定」（この設定が見つからない場合は、BGIが最新版に更新されていることを確認してください）、この項目が有効で、ポート番号が30648に設定されていることを確認してください。完了後、このページを閉じてBGIを再起動して再試行してください。まだ問題がある場合は、作者に連絡して解決してください。"},{q:"READMEとは何ですか、なぜ読み込みに失敗したのですか？なぜ表示されないのですか？",a:"まずREADMEを読んでください、理解できましたか？読み込み失敗は最初の質問と同じです。表示されないのは、そのディレクトリにREADME.mdファイルが存在しないからです。"},{q:"なぜ一部のリンクがクリックできないのですか？なぜ長時間読み込みしても読み込まれないのですか？",a:"最初の質問と同じです。"},{q:"購読をクリックした後、なぜ反応がないのですか？",a:"BGIを開いてください。この時、インポートウィンドウがポップアップします。インポートを選択してください。オンラインリポジトリを使用している場合、BGIページを更新した後、購読したスクリプトが表示されない場合は、ローカルリポジトリを更新して再試行してください。まだ異常がある場合は、関連グループで質問してください。"},{q:"このスクリプトが使えない場合はどうすればよいですか？",a:"関連グループで質問してください。具体的な問題は具体的に分析します。質問する際は、スクリーンショットと説明が十分であることを確認してください。"},{q:"以前のコメントがなぜ消えたのですか？",a:"一般的にコメントは削除されません。コメントが消えた場合、コメントしたノードパスが変更された可能性が高いです。例えば、クリスタル鉱石ディレクトリがクリスタルウォーター鉱石に名前が変更された場合、新しいコメントセクションが表示されます。"},{q:"なぜこのスクリプトはナヒーダを使用しないのですか？",a:"作者は全員が持っているかどうかを考慮する必要があります。必要な場合は、自分で作ってみてください。"},{q:"XX機能が欲しい場合はどうすればよいですか？",a:"作者が書いていない場合は、自分で書いてください！"},{q:"その他",a:"その他の質問については、私に連絡してください。価値がある場合は、このページも不定期に更新されます。"}]},bFe={descTitle:"説明：",noDesc:"説明なし",loadTimeout:"読み込みタイムアウト",loadFailed:"読み込み失敗",clickToViewFile:"GitHubリポジトリのファイルをクリックして表示",clickToViewDir:"GitHubリポジトリのディレクトリをクリックして表示",invalidLinkHint:"（この作者は愚かでリンクを間違えました。修正するよう彼らに伝えてください）"},SFe={help:"ヘルプ",jumpToGitHub:"GitHub",comment:"コメント",subscribe:"ワンクリック更新",update:"更新を確認",plan:"更新計画",recent:"最近の更新",updateAll:"全ての購読を更新しますか？",clearDot:"赤い点を消す",subscribed:"購読済み",confirm:"確認",cancel:"キャンセル"},EFe={subscribed:"購読済み",subscribe:"購読",subscribeAgain:"再購読",selectValidNode:"購読する有効なノードを選択してください",subscribeFailed:"購読に失敗しました",subscribeFailedWithMsg:"購読に失敗しました: {msg}",subscribeSuccess:"{name}の購読リンクがクリップボードにコピーされました",copyFailed:"{name}の購読リンクのコピーに失敗しました",noDesc:"なし"},yFe={hasUpdate:"更新あり",subscribed:"購読済み",noAuthor:"匿名"},CFe={hasUpdate:"更新あり",subscribed:"購読済み",noAuthor:"匿名"},TFe={hasUpdate:"更新あり",subscribed:"購読済み",noAuthor:"匿名"},xFe={comma:"、",noDesc:"説明なし",reset:"リセット",confirm:"確定"},OFe={author:"作者：",scriptAuthor:"作者",noAuthor:"匿名",subscribe:"購読",subscribed:"購読済み",subscribeAgain:"再購読",subscribeFailed:"購読に失敗しました",subscribeFailedWithMsg:"購読に失敗しました: {msg}",subscribeSuccess:"{name}の購読リンクがクリップボードにコピーされました",copyFailed:"{name}の購読リンクのコピーに失敗しました",loadingReadme:"readmeファイルを読み込み中",readmeFailed:"readmeファイルの読み込みに失敗しました。再試行してください",loadingSt ipts",mainRepo:"Visiter le Dépôt Principal BetterGI",scriptRepo:"Visiter le Dépôt de Scripts BetterGI",onlineRepo:"Visiter le Dépôt en Ligne",lastUpdate:"Dernière Mise à Jour : ",document:"Consultez la documentation officielle"},PFe={all:"Tout",subscribed:"Abonné",onlyLocal:"Disponible uniquement en mode local",searchMap:"Rechercher nom de ressource, auteur, tag",searchScript:"Entrer des mots-clés pour rechercher",searchCombat:"Entrer des mots-clés pour rechercher",searchTCG:"Entrer des mots-clés pour rechercher",searchDefault:"Entrer des mots-clés pour rechercher",author:"Auteur : ",noAuthor:"Anonyme",unknown:"Script Inconnu"},MFe={repoTitle:"Échec de récupération des informations du dépôt",repoDesc:"Vérifiez votre réseau ou actualisez la page plus tard"},LFe={title:"Commentaires",localModeTitle:"Les commentaires ne sont pas pris en charge en mode local",localModeDesc:"Veuillez visiter le dépôt en ligne pour les commentaires"},kFe={title:"Easter Egg",loading:"L'easter egg fait de son mieux pour charger...",error:"Échec du chargement malgré tous les efforts, veuillez réessayer"},FFe={title:"Plan de Mise à Jour",desc:"Voici quelques plans de mise à jour futurs. Toutes les contributions ou aides pour leur mise en œuvre sont les bienvenues. Pour le moment, je suis le seul auteur, donc la vitesse de mise à jour ne sera pas très rapide. Merci de votre compréhension !",link:"URL du Dépôt : https://github.com/zaodonganqi/bettergi-script-web",author:"Email de l'Auteur : anqi4051{'@'}gmail.com",planList:[{desc:"Support des Couleurs de Thème",content:"La configuration des couleurs actuellement utilisée dans le projet est encore fragmentée. Nous prévoyons de consolider les couleurs pour prendre en charge une configuration globale des couleurs de thème. Les solutions en attente incluent le mode sombre et le mode translucide (pour prendre en charge l'affichage d'arrière-plan personnalisé)."},{desc:"Renforcer l'Abonnement en un Clic",content:"Trouvez les scripts que vous avez déjà abonnés parmi les scripts mis à jour pour filtrer ceux qui peuvent être mis à jour en un clic. Bien sûr, mettre à jour tous les scripts aveuglément n'est pas très lent de toute façon."},{desc:"Ajouter une Documentation de Tutoriel Interne",content:"Ajoutez un tutoriel d'utilisation du dépôt dans la barre d'outils pour les novices en informatique, sauf pour ceux qui ne savent pas lire."},{desc:"Zones de Contenu Déplaçables",content:"Modifiez les vues comme les listes pour qu'elles soient redimensionnables par glisser-déposer plutôt que fixes, et enregistrez les données localement (envisagez d'ajouter un fichier de configuration dans le corps principal si la mise en cache n'est pas fiable)."},{desc:"Recherche Plus Puissante",content:"Améliorez la fonction de recherche. La recherche actuelle n'est qu'une détection de mots-clés ; une correspondance approximative doit être envisagée (cet élément a une faible priorité, car c'est beaucoup d'effort pour peu de résultats)."},{desc:"Animations Plus Avancées",content:"Fournissez plus d'effets d'animation pour les interactions de l'interface utilisateur."},{desc:"Améliorer la Liste des Scripts Mis à Jour",content:"Ajoutez un mécanisme de type routage (mais pas un routage réel) à la page, permettant de naviguer par un clic dans la vue des mises à jour."},{desc:"Confidence de l'Auteur",content:"Je n'écrirai pas la confidence dans le titre, héhé ! Actuellement, l'auteur est assez occupé à jongler avec des projets personnels, des études et du travail. S'il vous plaît, ne me blâmez pas pour les mises à jour lentes, wuwuwu. La meilleure façon de me pousser à mettre à jour est de sponsoriser l'auteur ou de donner une étoile à cet humble auteur (si vous ne savez pas ce qu'est une étoile, oubliez ça)."}]},BFe={title:"FAQ Q&A",modalTitle:"Note : Toute question doit être réfléchie ou documentée avant d'être posée",author:"Email de l'auteur : anqi4051{'@'}gmail.com",qa:[{q:"Pourquoi le dépôt échoue-t-il toujours à charger ?",a:"Le dépôt utilise des adresses GitHub, et les connexions directes depuis la Chine peuvent être intermittentes, ce qui est normal. Si cela ne s'ouvre pas, essayez plusieurs fois ou revenez dans quelques minutes. Vous pouvez aussi utiliser la page de dépôt local de BGI. (Si vous êtes un magicien, vous savez quoi faire)"},{q:"Pourquoi la fonction de commentaire n'est-elle pas disponible ?",a:"Les commentaires ne sont pas pris en charge en mode local. Veuillez visiter le dépôt en ligne et vous connecter à votre compte GitHub pour commenter. Comment utiliser GitHub, veuillez chercher vous-même."},{q:"Pourquoi n'y a-t-il pas de script XX ?",a:`Lors de la recherche, essayez de vous assurer que les mots-clés sont précis, comme "Fleur Douce". Si vous avez tout cherché et que vous ne le trouvez toujours pas, alors aucun auteur ne l'a écrit. Vous pouvez essayer d'en écrire un vous-même.`},{q:"Comment utiliser la fonction abonné ?",a:`"BetterGI → Paramètres → Paramètres du Serveur Http BetterGI" (si vous ne trouvez pas ce paramètre, assurez-vous que BGI est mis à jour vers la dernière version), assurez-vous que cet élément est activé et que le numéro de port est défini sur 30648. Après avoir terminé, fermez cette page et redémarrez BGI pour réessayer. S'il y a encore des problèmes, contactez l'auteur pour résolution.`},{q:"Qu'est-ce que README, pourquoi a-t-il échoué à charger ? Pourquoi n'est-il pas affiché ?",a:"Lisez d'abord README vous-même, comprenez-vous ? L'échec de chargement est le même que la première question. Il n'est pas affiché car il n'y a pas de fichier README.md dans ce répertoire."},{q:"Pourquoi certains liens ne peuvent-ils pas être cliqués ? Pourquoi cela charge-t-il longtemps sans charger ?",a:"Même que la première question."},{q:"Pourquoi n'y a-t-il pas de réponse après avoir cliqué sur s'abonner ?",a:"Veuillez ouvrir BGI, une fenêtre d'importation apparaîtra, sélectionnez importer. Si vous utilisez le dépôt en ligne et que le script auquel vous vous êtes abonné n'apparaît pas après avoir actualisé la page BGI, mettez à jour le dépôt local et réessayez. S'il y a encore des problèmes, demandez dans le groupe pertinent."},{q:"Que faire si ce script ne fonctionne pas ?",a:"Veuillez demander dans le groupe pertinent, les problèmes spécifiques nécessitent une analyse spécifique. Lors de la demande, assurez-vous que vos captures d'écran et descriptions sont suffisantes."},{q:"Pourquoi mes commentaires précédents ont-ils disparu ?",a:"Les commentaires ne sont généralement pas supprimés. Si les commentaires disparaissent, il est probable que le chemin du nœud sur lequel vous avez commenté ait changé. Par exemple, si le répertoire Crystal Ore a été renommé en Crystal Water Ore, vous verrez une nouvelle section de commentaires."},{q:"Pourquoi ce script n'utilise-t-il pas Nahida ?",a:"Les auteurs doivent considérer si tout le monde l'a. Si nécessaire, essayez d'en faire un vous-même."},{q:"Que faire si je veux la fonction XX ?",a:"Si aucun auteur ne l'a écrit, écrivez-en un vous-même !"},{q:"Autres",a:"Pour plus de questions, contactez-moi. Si c'est précieux, cette page sera mise à jour périodiquement."}]},UFe={descTitle:"Description : ",noDesc:"Aucune description",loadTimeout:"Délai d'attente de chargement",loadFailed:"Échec du chargement",clickToViewFile:"Cliquez pour voir le fichier dans le dépôt GitHub",clickToViewDir:"Cliquez pour voir le répertoire dans le dépôt GitHub",invalidLinkHint:"(Cet auteur est stupide et a mal écrit le lien, allez lui rappeler de le corriger)",iframeNotice:"En raison des restrictions de sécurité, ce contenu ne peut pas être affiché directement. Veuillez utiliser le dépôt local pour le visualiser"},HFe={help:"Aide",jumpToGitHub:"GitHub",comment:"Commentaire",subscribe:"Mise à jour en un clic",update:"Vérifier les mises à jour",plan:"Plan de mise à jour",recent:"Mises à jour récentes",updateAll:"Mettre à jour tous les abonnements ?",clearDot:"Effacer le point rouge",subscribed:"Abonné",confirm:"Confirmer",ca
